import React from 'react';
import styled from 'styled-components';
import logo from '../pictures/head.png';
import { breakpoints } from 'styled-bootstrap-responsive-breakpoints';
import Socials from "./Socials";
import LogoContainer from "./LogoContainer";

const Styles = styled.div`

background: #eeeeee;

@media (min-width: ${breakpoints.xs}) {
  height: 12em;
  img {
    width: 5em;
  }

  .small-p {
    di
  }
}


`

function Footer() {
  return (
    <Styles className="d-flex justify-content-around align-items-center">
      <div>
        <LogoContainer />
        <p className="normal-p">© Copyright 2020 Barber Andrew</p>
        <Socials />
      </div>
      <p className="small-p">© Copyright 2020 Barber Andrew</p>
    </Styles>
  );



}

export default Footer;
